					text: '"Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut at risus consectetur, eleifend dui ut, fringilla eros. Nunc id accumsan justo. Nulla vestibulum eu sem ut facilisis. Fusce turpis orci, tincidunt eget mattis ut, tincidunt vel nisi. Sed placerat felis quis ipsum tempor pulvinar. Nunc consectetur risus eu placerat tincidunt. In rhoncus tincidunt elit vitae hendrerit." appears written in main text field."',
					textone: 'the testdata',
					texttwo: 'Testdata has been entered',
					sayHelo: 'Hello',
					xml: '<capa.texto><titulo><titulo.original unidad="Disposición final" parte="quinta"/><titulo.rubrica>Modificación del <ca><to>Real Decreto 2042/1994, de 14 de octubre</to><ta> (<cita ref="RCL\1994\3205">RCL 1994, 3205</cita>)</ta></ca>, por el que se regula la inspección técnica de vehículos</titulo.rubrica></titulo><parrafo>1. El <ca><to>artículo 6</to><ta><cita ref="RCL\1994\3205#A.6"/></ta></ca>, apartado 5, del Real Decreto 2042/1994, de 14 de octubre, por el que se regula la inspección técnica de vehículos, queda redactado del modo siguiente:</parrafo><repro><parrafo>«Todo vehículo que haya sufrido, como consecuencia de un accidente u otra causa un daño importante que pueda afectar a algún elemento de seguridad de los sistemas de dirección, suspensión, transmisión o frenado, o al bastidor o estructura autoportante en los puntos de anclaje de alguno de estos órganos, deberá ser presentado a inspección antes de su nueva puesta en circulación, en la que se dictamine sobre la aptitud del vehículo para circular por las vías públicas.</parrafo><parrafo>El agente de la autoridad encargado de la vigilancia del tráfico que realice el informe y atestado será quien proponga la inspección del vehículo antes de su puesta en servicio después de la reparación. A estos efectos intervendrá el permiso de circulación del vehículo, remitiéndolo a la Jefatura de Tráfico de la provincia donde se haya producido el accidente. Dicha Jefatura o aquella en la que el interesado haya manifestado expresamente que desea recoger su permiso de circulación, si procede, comunicará a éste la necesidad de presentar el vehículo a inspección técnica y también se lo comunicará al órgano competente de la Comunidad Autónoma donde el interesado haya declarado al agente de la autoridad que el vehículo va a ser inspeccionado.</parrafo><parrafo>Cuando el interesado haya realizado las oportunas reparaciones, deberá llevar el vehículo hasta la estación ITV para pasar la inspección técnica amparado en la autorización de circulación que le haya facilitado la Jefatura de Tráfico y, si la inspección es favorable, previa presentación del informe, le será devuelto el permiso de circulación.</parrafo><parrafo>Si el resultado de la inspección fuera desfavorable, la estación ITV lo hará constar en el informe de inspección, procediendo conforme a lo previsto en el artículo 11, apartado 2».</parrafo></repro><parrafo>2. El <ca><to>artículo 11</to><ta><cita ref="RCL\1994\3205#A.11"/></ta></ca>, apartado 2, primer párrafo, del Real Decreto 2042/1994, de 14 de octubre, por el que se regula la inspección técnica de vehículos, queda redactado del modo siguiente:</parrafo><repro><parrafo>«Si el resultado de una inspección técnica fuese desfavorable, la estación ITV concederá a su titular, para subsanar los defectos observados, un plazo inferior a dos meses, cuya extensión concreta se determinará teniendo en cuenta la naturaleza de tales defectos. La estación retendrá la tarjeta ITV y el titular deberá proceder a la reparación del vehículo, que quedará inhabilitado para circular por las vías públicas, excepto para su traslado al taller o para la regularización de su situación y vuelta a la estación ITV para nueva inspección».</parrafo></repro></capa.texto>',
